  true,\n\t\"url\": null,\n\t\"notes\": \"See the Vehicle Infrastructure Initiative
  Proof of Concept data environment for a description of the Michigan Test Bed and
  the data collected there in 2008. In late January through early April 2010 a third
  set of trials was conducted at the Michigan Test Bed, again directed by the National
  Center for Atmospheric Research (NCAR). These trials used a small set of vehicles,
  similar to the trials in 2009, and concentrated on comparing atmospheric data from
  vehicle-mounted sensors to data from a nearby fixed weather observing station. The
  2010 data selected for inclusion in this data environment consists of RSE and OBE
  data for the six days with the most good data.\",\n\t\"license_title\": \"Other
